import React from 'react';
import { Container } from '@chakra-ui/react'

function Homepage() {
  return (
    <Container maxW = 'xl' centerContent >
        <Box
        d = 'flex'
        justifyContent = 'center'
        p={3}
        bg={'white'}
        >
            <Text>Talk-A-Tive</Text>
        </Box>
    </Container>
  )
}

export default Homepage;
